import "./Card.css";
import Link from "./Link";

const Card = (props) => {
  return (
    <div className="card">
      {console.log(props)}
      <image src={props.img}></image>
      <h3>{props.title}</h3>
      <p>{props.des}</p>
      <link href={props.link1}>link1</link>
      <link href={props.link2}>link2</link>
      {/* <Link link1={links[0][1]} lin/k2={links[0][2]}></Link> */}
    </div>
  );
};
export default Card;
